import React from "react";
import { Container, Header } from "semantic-ui-react";

const RecipeList = (recipes, searchedQuery) => {
  return (
    <Container>
      <Header
        size="huge"
        content={`RECIPIE LIST FOR ${searchedQuery}`}
        textAlign="center"
      />
    </Container>
  );
};

export default RecipeList;
